import { USER } from "../actionTypes";
import { UserElement } from "../../assets/propTypes";

const initialState: UserElement = {
  password: '',
  job: false,
  country: 'tr',
  service: 156,
  quoteNumber: 2,
  deal: false
};

export default function (state = initialState, action: any) {
  switch (action.type) {
    case USER: {
      return state.country
    };

    default:
      return state;
  }
}
